class storycard extends React.Component {
  render() {
    return (
      <div>
        <h2>{this.props.title}</h2>
        <input type={"text"} />
        <br/>
        <ul>
          <li>1</li>
          <li>1</li>
          <li>1</li>
          <li>1</li>
          <li>1</li>
          <li>1</li>
        </ul>
      </div>
    )
  }
}
